import React from 'react';

    const Tickets = ({ tickets }) => {
      return (
        <div>

          <center><h2>Tickets List</h2></center>
          <table>
          {tickets.map((ticket) => (
            <tr>
                <td>{ticket.title}</td>
                <td>{ticket.email}</td>
            </tr>
          ))}
          </table>
        </div>
      )
    };

    export default Tickets
